import React, { Component } from 'react';
import Icon from 'uxcore-icon';
import Formatter from 'uxcore-formatter';
import Dialog from 'uxcore-dialog';
import { formatDuring, media, deviceStatus } from '../../../utils/commonUtil';
import TestEchart from './testEchart';
import { requestAjax } from '../../../utils/requestUtils';

export default class TestEnd extends Component {
    static contextTypes = {
        router: React.PropTypes.object.isRequired
    }

    static propTypes = {
        isSingle: React.PropTypes.bool,
        deviceInfo: React.PropTypes.object
    }

    constructor(props) {
        super(props);
        this.state = {
            clientWidth: document.body.clientWidth,
            testDialogShow: false, // 测试蒸发率公式弹出框是否显示
            staticDialogShow: false // 静态蒸发率公式弹出框是否显示
        };

    }

    render() {
        let textFontSize = 16;

        let testingTypeText = '标准测试';

        if (this.props.deviceInfo.testingMode == 'CONSTANTPRESSURE' && this.props.deviceInfo.testingType == 'AUTO') {
            testingTypeText = '自动测试（常压模式）';
        } else if (this.props.deviceInfo.testingMode == 'PRESSUREBEARING' && this.props.deviceInfo.testingType == 'AUTO') {
            testingTypeText = '自动测试（承压模式）';
        } else if (this.props.deviceInfo.testingMode == 'CONSTANTPRESSURE' && this.props.deviceInfo.testingType == 'MANUAL') {
            testingTypeText = '手动测试（常压模式）';
        } else if (this.props.deviceInfo.testingMode == 'PRESSUREBEARING' && this.props.deviceInfo.testingType == 'MANUAL') {
            testingTypeText = '手动测试（承压模式）';
        }

        let staticImg = '';

        if (this.props.deviceInfo.insulationType == 'FOMULA1') {
            staticImg = 'data:image/png;base64,';
        } else if (this.props.deviceInfo.insulationType == 'FOMULA2') {
            staticImg = 'data:image/png;base64,';
        } else {
            staticImg = 'data:image/png;base64,';
        }

       
        return (
            <div className='flex flex-direction-column '>
                <div className='flex flex-direction-column' style={{ padding: 10 }}>
                    <div className='flex flex-direction-column fillParent' style={{ paddingTop: 10 }}>
                        <div style={{ fontSize: textFontSize }}>测试状态：{deviceStatus(this.props.deviceInfo.testingStatus)}</div>
                        <div style={{ fontSize: textFontSize }} onClick={() => this._showDialog('a0')}>测试蒸发率：{this.props.deviceInfo.a0+ '%/d'}</div>
                        <div style={{ fontSize: textFontSize }} onClick={() => this._showDialog('a20')}>静态蒸发率：{this.props.deviceInfo.a20 + '%/d'}</div>
                        <div style={{ fontSize: textFontSize }}>被检件内平均温度：{this.props.deviceInfo.t2 + 'K'}</div>
                        <div style={{ fontSize: textFontSize }}>日平均质量流量：{this.props.deviceInfo.qm + 'kg/d'}</div>
                        <div style={{ fontSize: textFontSize }}>日平均环境温度：{this.props.deviceInfo.t1 + 'K'}</div>
                        <div style={{ fontSize: textFontSize }}>测试介质：{media(this.props.deviceInfo.testingMedia)}</div>
                        <div style={{ fontSize: textFontSize }}>充满率：{this.props.deviceInfo.fillRate}</div>
                        <div style={{ fontSize: textFontSize }}>绝热性能测试结论：{this.props.deviceInfo.a20 > this.props.deviceInfo.ner ? '不符合' : '符合'}</div>
                        <div style={{ fontSize: textFontSize }}>测试方式：{testingTypeText}</div>
                    </div>
                </div>
                <TestEchart testMedia={this.props.deviceInfo.testingMedia} cylinderId={this.props.deviceInfo.id} testStatus={this.props.deviceInfo.testingStatus} mResult={true} testingMode={this.props.deviceInfo.testingMode}/>
                <Dialog
                    title={'测试蒸发率算法'}
                    visible={this.state.testDialogShow}
                    footer={[]}
                    onCancel={() => {
                        this.setState({
                            testDialogShow: false
                        });
                    }}
                >
                    <div className='flex flex-direction-column' style={{ fontSize: 15 }}>
                        <div><img src='data:image/png;base64,' /></div>
                        <div>
                            <div>a<sub>0</sub>------测试蒸发率，单位为百分比每天(%/d)</div>
                            <div>q<sub>m</sub>------蒸发气体质量流量平均值，单位为千克每天（kg/d） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.qm}</span></div>
                            <div>ψ------流量计的校正系数，标定时的给定值 值为:<span style={{ color: 'red' }}>1</span></div>
                            <div>ρ<sub>1</sub>------标准大气压（101.325kPa）下饱和液体的密度，单位为千克每立方米（kg/㎥） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.p1}</span></div>
                            <div>V------被检件的有效容积，单位为立方米（㎥）值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.v}</span></div>
                        </div>
                    </div>
                </Dialog>
                <Dialog
                    title={'静态蒸发率算法'}
                    visible={this.state.staticDialogShow}
                    footer={[]}
                    onCancel={() => {
                        this.setState({
                            staticDialogShow: false
                        });
                    }}
                >
                    <div className='flex flex-direction-column' style={{ fontSize: 15 }}>
                        <div><img src={staticImg} /></div>
                        <div>
                            <div>a<sub>20</sub>------静态蒸发率，单位为百分比每天(%/d)</div>
                            <div>a<sub>0</sub>------测试蒸发率，单位为百分比每天(%/d) 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.a0}</span></div>
                            <div>h------试验环境压力下饱和液体的汽化潜热，单位为千焦耳每千克（kJ/kg） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.h}</span></div>
                            <div>h<sub>fg</sub>------标准大气压（101.325kPa）下饱和液体的汽化潜热，单位为千焦耳每千克（kJ/kg） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.hfg}</span></div>
                            <div>T<sub>s</sub>------标准大气压（101.325kPa）下饱和液体的温度，单位为开尔文（K） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.ts}</span></div>
                            <div>T<sub>1</sub>------试验时日平均环境温度，单位为开尔文（K） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.t1}</span></div>
                            <div>T<sub>2</sub>------试验时被检件内日平均压力对应的深冷液体饱和温度，单位为开尔文（K） 值为:<span style={{ color: 'red' }}>{this.props.deviceInfo.t2}</span></div>
                        </div>
                    </div>
                </Dialog>
            </div>);
    }

    _showDialog(key) {

        if (key == 'a0') {
            this.setState({
                testDialogShow: true
            });
        } else {
            this.setState({
                staticDialogShow: true
            });
        }
    }
  
}